{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/piotrpowroznik/laplace-s-equation-for-heat-distribution?scriptVersionId=266442368\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"c42f31ab","metadata":{"papermill":{"duration":0.002716,"end_time":"2025-10-07T21:55:24.431377","exception":false,"start_time":"2025-10-07T21:55:24.428661","status":"completed"},"tags":[]},"source":["# Laplace's Equation for Heat Distribution\n","Heat distribution can be simulated using Laplace's Equation.\n","General form of the Laplace's Equation in two dimensions is given by formula: \n","$$\n","F = A\\frac{\\partial^2 u}{\\partial x^2} + B\\frac{\\partial^2 u}{\\partial x \\partial y} + C\\frac{\\partial^2 u}{\\partial y^2}\n","$$\n","\n","$$Where $$\n","\n","$$B^2-4AC<0: elliptic $$\n","$$B^2-4AC=0: parabolic $$\n","$$B^2-4AC>0: hyperbolic $$\n","\n","Laplace's Equation can be calculated using it's standard discretized form:\n","\n","$$\n","u_{i,j} = \\frac{1}{4}[u_{i+1,j} + u_{i-1,j} + u_{i,j-1} + u_{i,j+1}]\n","$$\n","\n","This equation represents the value at grid point (i,j) as the **average of its four neighboring points** in a discrete grid."]},{"cell_type":"code","execution_count":1,"id":"e0bb8aca","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:55:24.439958Z","iopub.status.busy":"2025-10-07T21:55:24.437752Z","iopub.status.idle":"2025-10-07T21:55:24.630475Z","shell.execute_reply":"2025-10-07T21:55:24.628529Z"},"papermill":{"duration":0.199317,"end_time":"2025-10-07T21:55:24.632922","exception":false,"start_time":"2025-10-07T21:55:24.433605","status":"completed"},"tags":[]},"outputs":[],"source":["library(animation)\n","library(IRdisplay)"]},{"cell_type":"markdown","id":"2aefd09b","metadata":{"papermill":{"duration":0.002064,"end_time":"2025-10-07T21:55:24.637219","exception":false,"start_time":"2025-10-07T21:55:24.635155","status":"completed"},"tags":[]},"source":["## Initial Conditions"]},{"cell_type":"code","execution_count":2,"id":"c6a0ea41","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:55:24.679992Z","iopub.status.busy":"2025-10-07T21:55:24.643131Z","iopub.status.idle":"2025-10-07T21:55:24.707397Z","shell.execute_reply":"2025-10-07T21:55:24.70553Z"},"papermill":{"duration":0.070822,"end_time":"2025-10-07T21:55:24.710049","exception":false,"start_time":"2025-10-07T21:55:24.639227","status":"completed"},"tags":[]},"outputs":[],"source":["# Initializing matrices\n","Lnew <- matrix(nrow = 10, ncol = 10, 0)\n","L <- matrix(nrow = 10, ncol = 10, 0)\n","\n","# Boundary conditions\n","L[, 1] <- rep(0, 10)\n","L[, 10] <- rep(0, 10)\n","L[1, ] <- rep(0, 10)\n","L[10, ] <- rep(1, 10)\n","\n","Lnew <- L\n","\n","# Calculating the initial mean\n","L_mean <- mean(L)\n","s <- 0"]},{"cell_type":"markdown","id":"846d4c24","metadata":{"papermill":{"duration":0.002097,"end_time":"2025-10-07T21:55:24.714295","exception":false,"start_time":"2025-10-07T21:55:24.712198","status":"completed"},"tags":[]},"source":["## Create Animation"]},{"cell_type":"code","execution_count":3,"id":"7102abc2","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:55:24.722021Z","iopub.status.busy":"2025-10-07T21:55:24.72032Z","iopub.status.idle":"2025-10-07T21:55:26.32797Z","shell.execute_reply":"2025-10-07T21:55:26.326081Z"},"papermill":{"duration":1.614461,"end_time":"2025-10-07T21:55:26.330722","exception":false,"start_time":"2025-10-07T21:55:24.716261","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Output at: animation.gif\n","\n"]},{"data":{"text/html":["TRUE"],"text/latex":["TRUE"],"text/markdown":["TRUE"],"text/plain":["[1] TRUE"]},"metadata":{},"output_type":"display_data"}],"source":["# Saving the GIF animation\n","saveGIF({\n","  k <- 1\n","  while(TRUE) {\n","    # Adding image for initial state\n","    if (k == 1) {\n","      Limg <- apply(L, 2, rev)\n","      image(t(Limg))\n","      text(0, 1, 0)\n","    }\n","\n","    # Updating matrix values using Laplace's equation\n","    for (i in 2:9) {\n","      for (j in 2:9) {\n","        Lnew[i, j] <- 0.25 * (L[i - 1, j] + L[i + 1, j] + L[i, j - 1] + L[i, j + 1])\n","      }\n","    }\n","\n","    # Updating the matrix L\n","    L <- Lnew\n","\n","    # Displaying the result every 10 iterations\n","    if (k %% 10 == 0) {\n","      Limg <- apply(L, 2, rev)\n","      image(t(Limg))\n","      text(0, 1, k)\n","    }\n","\n","    # Calculating the new mean of the matrix L\n","    Ln_mean <- mean(L)\n","    s <- s + 1\n","\n","    # Stop condition\n","    if ((Ln_mean - L_mean) / L_mean < 0.001) {\n","      break\n","    }\n","    \n","    # Updating the mean for the next iteration\n","    L_mean <- Ln_mean\n","\n","    k <- k + 1\n","  } \n","})\n"]},{"cell_type":"markdown","id":"e2b416e6","metadata":{"papermill":{"duration":0.002315,"end_time":"2025-10-07T21:55:26.335572","exception":false,"start_time":"2025-10-07T21:55:26.333257","status":"completed"},"tags":[]},"source":["## View Animation"]},{"cell_type":"code","execution_count":4,"id":"a0e0494f","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:55:26.343804Z","iopub.status.busy":"2025-10-07T21:55:26.34202Z","iopub.status.idle":"2025-10-07T21:55:26.360566Z","shell.execute_reply":"2025-10-07T21:55:26.358747Z"},"papermill":{"duration":0.025285,"end_time":"2025-10-07T21:55:26.363127","exception":false,"start_time":"2025-10-07T21:55:26.337842","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"R0lGODlh4AHgAffrAAAAAAEBAQICAgQEAwQEBAcHBQcHBwgICAkJCQoKCgsLCwwMDA4ODg8P\nDxAQEBERERQUEBQUFBUVFRcXFxsbFR0dFxgYGBoaGhsbGx4eGBwcHB0dHR4eHiUlHSYmHiAg\nICEhISIiIiUlJSYmJi0tIygoKCkpKSoqKiwsLC0tLS4uLi8vLzExJjIyJzAwMDExMTIyMjMz\nMzU1NTY2Njc3Nzk5OTo6Ojs7Ozw8PEcEGEgFGUkGGkoHG0sIHE4LH0kXJlcXKnsDJ30AJXwE\nKH4GKncYNGMgNE9PPkBAQEFBQUNDQ0REREZGRkhISElJSUpKSktLS0xMTE1NTU5OTk9PT1d